import React from 'react';
import Form from 'react-bulma-components';
import Field from 'react-bulma-components';
import Control from 'react-bulma-components';
import Input from 'react-bulma-components';

const SearchForm = (handleSubmitProp) => {
  return (
    <Form onSubmit={handleSubmitProp}>
      <Field>
        <Control>
          <Input type="text" name="input" placeholder="text input" />
        </Control>
      </Field>
    </Form>
  );
};

export default SearchForm;
